import React from 'react';
import '../App.css';

function Projects() {
    return (<div>

                <ul class="pagination">
                    <li class="active">React</li>
                    <li class="waves-effect">Angular</li>
                    <li class="waves-effect">JAVA</li>
                    <li class="waves-effect">Python</li>
                    <li class="waves-effect">C</li>
                </ul>

            </div> );
}

export default Projects;
